import React from "react";
import "./styles.scss";
import { Box, Grid, Typography } from "@material-ui/core";
import { styled } from "@material-ui/core/styles";

const Item = styled(Box)({
  padding: "8px",
  background: "",
});

export default function Home() {
  return (
    <Box className="home-admin mt-5">
      <Grid container className="list-top px-3" spacing={1}>
        <Grid item xs className="">
          <Item>
            <Typography variant="body1" color="#999">
              Used Space
            </Typography>
          </Item>
        </Grid>
        <Grid item xs>
          <Item></Item>
        </Grid>
        <Grid item xs>
          <Item></Item>
        </Grid>
        <Grid item xs>
          <Item></Item>
        </Grid>
      </Grid>
    </Box>
  );
}
